import React, { Component } from 'react';
import UseState from './UseState';


class Page extends Component {
    
    constructor(props) {
        super(props);
        this.state = {
          login: false
        };
        
    }

    loginChange(event) {
        
        this.setState({login: event.target.value});
    }

    render() {
        return(
            <div className="Page">
                <UseState />
            </div>
        );
    }
}

export default Page;
